import React from "react";
import { Route, Switch } from 'react-router-dom';
import Home from "./Pages/Home";
import About from "./Pages/About";
import Belief from "./Pages/Belief";
import Gallery from "./Pages/Gallery";
import Team from "./Pages/Team";
import Error from "./Error";

  const App = () => {
    const toggleClass = () => {
      return "dark theme"
    }
    return (
      <main>
          <Switch>
              <Route path="/" render={renderprops =>
                <Home toggleClass={toggleClass} {...renderprops} />} exact />
              <Route path="/about" render={renderprops =>
                <About toggleClass={toggleClass} {...renderprops} />} />
              <Route path="/belief" render={renderprops =>
                <Belief toggleClass={toggleClass} {...renderprops} />} />
              <Route path="/gallery" render={renderprops =>
                <Gallery toggleClass={toggleClass} {...renderprops} />} />
              <Route path="/team" render={renderprops =>
                <Team toggleClass={toggleClass} {...renderprops} />} />
              <Route render={renderprops =>
                <Error toggleClass={toggleClass} {...renderprops} />} />
          </Switch>
      </main>
    )
  }
  export default App;
